INSERT INTO `ng_events` VALUES (1,'Carrera Solidaria 2024','Carrera de 5K y 10K para recaudar fondos destinados a la construcción de viviendas en comunidades rurales. Incluye actividades familiares, rifas y venta de comida.','fundraising','2025-11-22 07:00:00','2025-11-22 12:00:00','Parque Central de Antigua Guatemala','Parque Central, Antigua Guatemala, Sacatepéquez',500,5,1,'2025-11-17 09:10:00',50.00,'published',1,0,'events/carrera-solidaria-2024_1761276789.jpg','carrera@ongvivienda.org','+502 5555-1234','Ropa deportiva cómoda, hidratación, documento de identidad. Menores de 16 años deben estar acompañados por un adulto.',1,1,'2025-10-23 09:10:01','2025-10-24 03:33:09'),(2,'Taller de Construcción Sostenible','Capacitación práctica sobre técnicas de construcción ecológica y sostenible. Dirigido a constructores locales y voluntarios.','training','2025-11-07 08:00:00','2025-11-09 17:00:00','Centro de Capacitación Comunitario','Aldea San Juan, Chimaltenango, Guatemala',25,5,1,'2025-11-02 09:10:00',50000.00,'published',0,0,'events/taller-de-construccion-sostenible_1761352565.png','capacitacion@ongvivienda.org','+502 5555-5678','Ropa de trabajo, botas de seguridad, guantes, casco. Conocimientos básicos de construcción preferible.',1,2,'2025-10-23 09:10:01','2025-10-25 00:36:05'),(3,'Feria de Voluntariado','Evento para reclutar nuevos voluntarios y mostrar los proyectos en curso. Incluye presentaciones, testimonios y actividades interactivas.','volunteer','2025-12-07 09:00:00','2025-12-07 16:00:00','Universidad de San Carlos de Guatemala','Ciudad Universitaria, Zona 12, Ciudad de Guatemala',200,0,0,NULL,0.00,'published',1,0,'events/feria-de-voluntariado_1761279151.jpg','voluntarios@ongvivienda.org','+502 5555-9012','Interés en el voluntariado social, disponibilidad de tiempo.',1,NULL,'2025-10-23 09:10:01','2025-10-24 04:12:31'),(4,'Campaña de Concientización sobre Vivienda Digna','Campaña educativa en comunidades urbanas marginadas para sensibilizar sobre la importancia de la vivienda digna y los derechos habitacionales.','awareness','2025-12-22 14:00:00','2025-12-22 18:00:00','Mercado Central de Quetzaltenango','Centro Histórico, Quetzaltenango, Guatemala',100,0,0,NULL,49999.96,'published',0,0,'events/campana-de-concientizacion-sobre-vivienda-digna_1761352637.jpg','conciencia@ongvivienda.org','+502 5555-3456','Disponibilidad para interactuar con la comunidad, conocimiento básico de los derechos habitacionales.',1,NULL,'2025-10-23 09:10:01','2025-10-25 00:37:17'),(5,'Construcción Comunitaria - Casa Modelo','Construcción participativa de una casa modelo con la comunidad. Los participantes aprenderán técnicas de construcción mientras contribuyen al proyecto.','community','2026-01-21 07:00:00','2026-01-21 16:00:00','Aldea El Progreso, Huehuetenango','Aldea El Progreso, Huehuetenango, Guatemala',40,3,1,'2026-01-16 09:10:00',4000.00,'published',1,0,'events/construccion-comunitaria-casa-modelo_1761352727.jpg','construccion@ongvivienda.org','+502 5555-7890','Ropa de trabajo, botas de seguridad, guantes, casco. Física y mentalmente preparado para trabajo de construcción.',1,3,'2025-10-23 09:10:01','2025-10-25 00:38:47'),(6,'Reunión de Evaluación Trimestral','Reunión interna para evaluar el progreso de los proyectos del trimestre y planificar las actividades del próximo período.','other','2025-10-30 09:00:00','2025-10-30 12:00:00','Oficinas Centrales ONG','Zona 10, Ciudad de Guatemala, Guatemala',20,4,1,'2025-10-28 09:10:00',0.00,'draft',0,0,'events/reunion-de-evaluacion-trimestral_1761352592.jpg','admin@ongvivienda.org','+502 5555-2468','Solo personal de la organización y invitados especiales.',1,NULL,'2025-10-23 09:10:01','2025-10-25 00:36:32'),(7,'Cena de Gala Anual','Evento de recaudación de fondos con cena de gala, subasta silenciosa y presentación de resultados del año. Dirigido a donantes y patrocinadores.','fundraising','2026-02-20 19:00:00','2026-02-20 23:00:00','Hotel InterContinental Guatemala','14 Calle 2-51, Zona 10, Ciudad de Guatemala',150,4,1,'2026-02-10 09:10:00',200.00,'published',1,0,'events/cena-de-gala-anual_1761352762.png','gala@ongvivienda.org','+502 5555-1357','Vestimenta formal, confirmación de asistencia requerida.',1,NULL,'2025-10-23 09:10:01','2025-10-25 00:39:22'),(8,'Taller de Liderazgo Comunitario','Capacitación para líderes comunitarios sobre gestión de proyectos, resolución de conflictos y desarrollo comunitario sostenible.','training','2026-01-06 08:00:00','2026-01-08 17:00:00','Centro de Desarrollo Comunitario','Cobán, Alta Verapaz, Guatemala',30,2,1,'2026-01-01 09:10:00',25.00,'published',0,0,'events/taller-de-liderazgo-comunitario_1761352674.png','liderazgo@ongvivienda.org','+502 5555-9753','Ser líder comunitario reconocido, compromiso de aplicar conocimientos en su comunidad.',1,4,'2025-10-23 09:10:01','2025-10-25 00:37:54');
