INSERT INTO `ng_projects` VALUES (1,'Educación Comunitaria Rural','Proyecto enfocado en mejorar el acceso a la educación en comunidades rurales marginadas, proporcionando materiales educativos, capacitación docente y apoyo escolar.','Reducir el analfabetismo en 5 comunidades rurales en un 40% durante el primer año','500 niños y niñas de 6 a 15 años, 50 maestros rurales',250000.00,200000.00,75000.00,'2024-01-15','2025-01-15','en_progreso',3,'Comunidades rurales del estado de Oaxaca','Mejora en el rendimiento académico, reducción del abandono escolar, capacitación de maestros','Se han capacitado 30 maestros, se han distribuido 200 kits escolares','ejecucion',50,'2025-10-23 09:10:01','2025-10-24 06:28:59',1,1),(2,'Salud Preventiva Infantil','Iniciativa para implementar programas de vacunación, nutrición y atención médica preventiva en zonas urbanas marginadas.','Vacunar al 95% de los niños menores de 5 años en 3 colonias marginadas','800 niños menores de 5 años, 200 familias',180000.00,150000.00,90000.00,'2024-03-01','2024-12-31','en_progreso',2,'Colonias marginadas de la Ciudad de México','Reducción de enfermedades prevenibles, mejora en el estado nutricional infantil','Se han vacunado 600 niños, se han realizado 150 consultas nutricionales','evaluacion',80,'2025-10-23 09:10:01','2025-10-24 06:40:39',1,1),(3,'Desarrollo Empresarial Femenino','Programa de capacitación y financiamiento para mujeres emprendedoras en comunidades rurales, enfocado en microempresas sostenibles.','Crear 50 microempresas lideradas por mujeres en 10 comunidades rurales','100 mujeres emprendedoras, 200 familias indirectas',320000.00,280000.00,120000.00,'2024-02-01','2025-08-01','en_progreso',3,'Comunidades rurales de Chiapas y Guerrero','Empoderamiento económico femenino, generación de empleo local, desarrollo comunitario','Se han capacitado 60 mujeres, se han creado 15 microempresas','financiacion',30,'2025-10-23 09:10:01','2025-10-24 06:40:43',1,1),(4,'Agua Potable y Saneamiento','Instalación de sistemas de purificación de agua y construcción de letrinas ecológicas en comunidades sin acceso a servicios básicos.','Proporcionar agua potable a 3 comunidades rurales (500 familias)','500 familias (2,500 personas aproximadamente)',450000.00,400000.00,200000.00,'2024-01-01','2024-12-31','en_progreso',2,'Comunidades rurales de Puebla y Veracruz','Acceso a agua potable, reducción de enfermedades gastrointestinales, mejora en la calidad de vida','Se han instalado 2 sistemas de purificación, se han construido 50 letrinas','ejecucion',50,'2025-10-23 09:10:01','2025-10-24 06:40:44',1,1),(5,'Apoyo a Adultos Mayores','Programa integral de atención y acompañamiento para adultos mayores en situación de vulnerabilidad, incluyendo atención médica, alimentación y actividades recreativas.','Atender a 200 adultos mayores en situación de abandono o vulnerabilidad','200 adultos mayores, 100 familias cuidadoras',150000.00,120000.00,60000.00,'2024-04-01','2025-04-01','en_progreso',3,'Centros comunitarios en zonas urbanas marginadas','Mejora en la calidad de vida de adultos mayores, reducción del aislamiento social','Se han atendido 80 adultos mayores, se han realizado 200 consultas médicas','formulacion',15,'2025-10-23 09:10:01','2025-10-24 06:40:46',1,1),(6,'Capacitación Técnica Juvenil','Programa de formación técnica en oficios demandados para jóvenes de 16 a 25 años en situación de vulnerabilidad social.','Capacitar a 300 jóvenes en oficios técnicos con alta demanda laboral','300 jóvenes de 16 a 25 años',280000.00,250000.00,0.00,'2024-09-01','2025-09-01','planificado',3,'Centros de capacitación en 5 ciudades principales','Inserción laboral del 70% de los capacitados, mejora en las oportunidades económicas','Proyecto en fase de planificación','diagnostico',0,'2025-10-23 09:10:01','2025-10-24 06:40:48',1,1),(7,'Conservación Ambiental Comunitaria','Proyecto de reforestación y educación ambiental en comunidades rurales, enfocado en la conservación de ecosistemas locales.','Reforestar 50 hectáreas y capacitar a 200 familias en prácticas ambientales sostenibles','200 familias rurales, 1,000 personas indirectas',200000.00,180000.00,45000.00,'2024-06-01','2025-06-01','en_progreso',2,'Reservas naturales y comunidades rurales de Michoacán','Restauración de ecosistemas, conciencia ambiental comunitaria, prácticas sostenibles','Se han reforestado 15 hectáreas, se han capacitado 80 familias','cierre',100,'2025-10-23 09:10:01','2025-10-25 00:22:04',1,1);
